import React from "react";

import "./Card.css";
import Cover from "../Pictures/cover.jpg";


function Card() {
  
  return (
    <>
      <div className="container">
        <img src={Cover} alt="Cover_Picture" />
      </div>
    </>
  );
}

export default Card;
